    public function getSourceContext()
    {
        return new Source("{% extends \"base.html.twig\" %}

{% block stylesheets %}
    <link rel=\"stylesheet\" href=\"{{ asset('css/security.css') }}\" />
{% endblock %}

{% block content %}
    <div class=\"login-div\">
        <h1> OSMIRSYS 1.0 </h1>

        {% if error %}
            <div>{{ error.messageKey|trans(error.messageData, 'security') }}</div>
        {% endif %}

        <form action=\"{{ path('login') }}\" method=\"get\">
            <div class=\"form-field\">
                <div class=\"form-label\"><label for=\"username\">Username:</label></div>
                <div class=\"form-input\"><input type=\"text\" id=\"username\" name=\"_username\" value=\"{{ last_username }}\" /></div>
                <div class=\"clearfix\"></div>
            </div>

            <div class=\"form-field\">
                <div class=\"form-label\"><label for=\"password\">Password:</label></div>
                <div class=\"form-input\"><input type=\"password\" id=\"password\" name=\"_password\" /></div>
                <div class=\"clearfix\"></div>
            </div>

            {#
                If you want to control the URL the user
                is redirected to on success (more details below)
                <input type=\"hidden\" name=\"_target_path\" value=\"/account\" />
            #}
            <div class=\"form-field\">
                <button type=\"submit\">login</button>
            </div>
        </form>
    </div>
{% endblock %}
", "security/login.html.twig", "/var/www/html/symfony/app/Resources/views/security/login.html.twig");
